import React from "react";
import PublishedSlider from "../PublishedSlider";
import "./index.scss";

function View(props) {
  return (
    <div className="recommendations">
      <PublishedSlider
        publishedList={
          props.recommendations.map(
            recommendation => recommendation.project
          )
        }
      />
    </div>
  );
}

export default View;
